import React from 'react'
import { Card, CardCategory, FlexWrapper, StyledCard } from './Styled'
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";


function Cards() {
  return (
    <FlexWrapper>
      <Swiper
        spaceBetween={50}
        slidesPerView={2}
        onSlideChange={() => console.log("slide change")}
        onSwiper={(swiper) => console.log(swiper)}
      >
        <SwiperSlide>
          <StyledCard>
            <CardCategory>POP</CardCategory>
          </StyledCard>
        </SwiperSlide>
        <Card>
          <CardCategory>INDIE</CardCategory>
        </Card>
        <StyledCard>
          <CardCategory>RAP</CardCategory>
        </StyledCard>
        <Card>
          <CardCategory>RETRO</CardCategory>
        </Card>
      </Swiper>
    </FlexWrapper>
  );
}

export default Cards
